bno_random_0001.title: "廊下での騒音" # AI Tags
bno_random_0001.desc: "暗闇はあなたの土地を征服し 城の悪気な廊下を歩きながら 暗闇の夜は 迅速にろうそくを必要とする. 夜寝る部屋へ向かうと 微妙な音が聞こえてきます 音が強く鳴り上がり すぐに窒息します.\n\n誰か困っているの? 自分を防衛する資格はないし,別の人もそうではないが,本能が導いてくれる.\n\nアドレナリンが体を通り抜けると [target2.GetFirstName]. \n\n覗き込むと 大きな暗黒な姿が見えてくる 小さな白い体に 曲がりくねり 腰を引っ張って…\n\n頬は赤くなって [target1.GetFirstName] 巨大な黒いシャフトを [target2.GetFirstName]脱出して その輝く肉を 再び刺すために." # AI Tags
bno_random_0001.a: "自分に触れる必要がある…" # AI Tags
