bno_random_2012.title: "キャンプ終了: タグ チーム" # AI Tags
bno_random_2012.desc: ""もう一人?" 彼は眉を上げて響く. キャンプの周りを瞬く間に眺めながら 彼は言いました "こんにちは 女の子よ." 唇を叩き 首をひっくり返して ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら ほら. "そうよ." わかったわ"\n\nあなたの旅はあなたをキャンプの真ん中に 連れて行きます キャンプファイアの前に 別の難民が 伐採された木の上に 腰を下げて パンを噛んでいるのです. しかし,あなたがた2人が近づいて行くと,彼の目は高くなり,瞬く間にあなたがたの揺るぎない胸の上に座ります. 鼻の穴を離れて,迅速に立ち上がって [target1.GetFirstName] あなたを導きます.\n\n"[target1.GetFirstName]ほら! "誰だ"\n\n"リラックスして. 彼女は2人の兄弟を探している"\n\nすぐには空気が変わります 新しい男が 到着したのは 捕らえられた人の一人ではなく 双子の為に 自分の身体を 喜んで捧げるのだと気づきます. 何度か瞬く間に 火の男が 近づいて近づいて 近くで見る前に 調整するのに 時間がかかります. 腕を伸ばして"異国"の胸を撫でます.\n\n短時間で,あなたの服は剣によって裂かれます [target1.GetFirstName] 裸体で2つと対照しています. "さあ 唇を巻いて" [target2.GetFirstName] 髪の毛を束ねて 尻尾の先まで導いて [target1.GetFirstName] お前の後ろに立ってる ピンクなクズに もうインチ入ってる.\n\n"いい娼婦よ" [target1.GetFirstName] お尻を殴り 鳴らして 他のアフリカ人のチンコを窒息させました. あなたのしもべたちが 塔の周りにあなたを捜していた時,あなたは現在 2つの吊るしたの間を通過され, あなたをピストンして出て,喜びの涙を流せました." # AI Tags
