bno_random_0013.desc: "寝室で快適に横たわって 周囲の贅沢を楽しみながら 突然の混乱は その時の平和を崩します. ドアが開き 驚いたことに 4人のほぼ裸の黒人が 部屋に突入しました. 彼らの指導者は [target1.GetFirstName]勇気を持って前進します.\n\n"止めて! 我々はあなたの宮廷を我々の存在で 飾ることに決めた. あなたは私の同志を喜ばせ,彼らと一緒に生きることを許してください! 聞こえたわ! 住居を要求し 引き換えに アフリカ文化を あなたの宮廷に紹介する. 公平な取引じゃないですか"\n\n4 人 は あなた に 近づい て 来る の です.その 時 だけ で,あなた は,彼らが"パンツ"として 履いている 小さな 品物 の 下 で 何 を 詰め て いる か を 見える こと が でき ます.その 巨大な 黒い 子 子 は,ほぼ 三つ目の 足 の よう に,その 下 に ぶら下がり て いる の で,あなた は 畏敬 を 感じ ます." # AI Tags
