bno_random_0024.title: "夜 の 泥棒 の よう に" # AI Tags
bno_random_0024.desc: "あなたの名高いスパイマスターの 仲間の一人は 秘密の秘密を 報酬として交換するために 夜の隠れ間にお会いすることに同意した. コインの袋を持ってきて 庭内にある マルマの弓の下に 待って 足を蹴りながら 時間を過ごします. 見上げると 月が昇り 輝きをあなたの原始の領域に投じています.\n\n何分も経たないうちに 足が右に動いているのを聞くと すぐに目を向けるようになり 何メートルも離れたところに 隠れた姿が見えなくなるのです. 実際 もし敵意があったなら 簡単に襲撃して この地球でのあなたの時間を終わらせることができた. その代わりに,彼は隠れ家から立ち去り,情報を持った外国人の姿を明らかにしました.\n\n"キリスト!"あなたは叫び,彼の突然の出現はあなたから日光を怖がらせる. あなたの胸を握って,あなたは立ち上がる, 遠くからあなたの顔を隠すヴェル, しかしあなたの穴を開く目をよく見えた [target1.GetFirstName]… "あなた は わたし に 何 を 持っ て い ます か"と 尋ねる の で,スパイ は 情報を 披露 する ため に 時間 を 無駄 に し て い ませ ん.\n\n"残念ながら,それしか知らない…今のところ. 支払いの場合は…"彼は背中を直し,衣装を脱ぎ,彼の美しさはまだ薄い光で明らかです.\n\n"もちろんね"と すぐ返事し 腰から 硬貨の袋を引っ張って 彼に差し出します.\n\n"お金?"と嘲笑し 頭を振って お金を留めろって. "もっと…具体的なものを欲しい" [target1.GetFirstName] 肩に手を差し伸べて 圧力をかけます. "あなたの身体"" # AI Tags
