\n\nあなたの下にある男は ほっこりして 胸を軽く叩き 握りしめきの中で 握りしめきをして 自分の完成に近づいています. 急いで 予告もなく 興奮の高さに 身体が爆発し 悲哀の叫び声が 押しつぶされ 逃げようとすると気づきます. 運河の緊張により 残りの2人は 折りたたみ 諦め 汚れた穴の中に 押し入って 空っぽになる." # AI Tags
